import React from 'react';

const Todo = ({ todo }) => {
  return (
    <div>
      <div>id : {todo.id}</div>
      <div>task : {todo.task}</div>
      <div>completed : {todo.completed}</div>
      <div>priority : {todo.priority}</div>
      <div>-------------------</div>
    </div>
  );
};

export default Todo;
